import React from 'react';
import './css/Footer.css';

function Footer() {
    return (
        <div className="bottom">
            <ul className="links">
                <li className="privacy">
                    <a href="/page/serviveagreement">(주) 우아한 명지대</a>
                </li>
                <li className="copyright">
                    <a href="/">© HAYEON & SEUNGMIN</a>
                </li>
            </ul>
        </div>
    )
}

export default Footer
